import React from 'react'
import { InputGroup, FormControl, Button } from 'react-bootstrap';
export default class CreateRovers extends React.Component{
    render(){
        return(
            <div>
            <div id={this.props.rover} key={this.props.rover}> 
                <InputGroup > 
                    <InputGroup.Prepend>
                    <InputGroup.Text >Rover#{this.props.rover} init location</InputGroup.Text>
                    <FormControl  onChange={this.props.handleRoverLocationX}
                    />
                    <FormControl  onChange={this.props.handleRoverLocationY}
                    />
                    <InputGroup.Text >Init</InputGroup.Text>
                    <FormControl  onChange={this.props.handleRoverLocationZ}
                    />
                    <InputGroup.Text >Movements</InputGroup.Text>
                    <FormControl className="input-group-move" onChange={this.props.handleMovementsInput}
                    />
                    <Button onClick={this.props.handleRoverMovment} variant="success">Build rover</Button>
                    </InputGroup.Prepend>
                </InputGroup>
            </div> 
            </div>
        )
    }
}
